	DECLARE is_secured INT default 0;



	 if ( ifnull(
     (

     select count(users.id)
     from userdevice
     right join users on (userdevice.userId=users.id)

     where userdevice.deviceId = in_deviceId and users.deviceRoleId = 14

     ), 0) > 0) then
        set is_secured =  1;
     END if;
RETURN is_secured;
END ;;
