CREATE DEFINER=`root`@`localhost` FUNCTION `GET_IN_TIME_FUNC`(userId int, attendanceTimeinput datetime) RETURNS datetime
BEGIN
	declare min_in_time datetime;
    set min_in_time = (SELECT
                MIN(attendance.`attendanceTime`)
            FROM
                `attendance`
            WHERE
                attendance.`entryById` = userId
                AND DATE_FORMAT(attendance.`attendanceTime`, '%Y-%m-%d') = DATE_FORMAT(`attendanceTimeinput`, '%Y-%m-%d'));
RETURN min_in_time;
END ;;
