CREATE DEFINER=`root`@`localhost` FUNCTION `GET_SHIFTING_TIME_FUNC`(shiftId int) RETURNS varchar(20) CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci
BEGIN
	 DECLARE shifting_time varchar(20);

     set shifting_time = ( select
			concat(

                calc_time_am_pm(inTimeHour, inTimeMin ),
                ' - ',
                calc_time_am_pm(outTimeHour, outTimeMin )
            )

			from shiftings where shiftingId=shiftId);

RETURN shifting_time;
END ;;
